import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';

export default ({styles}) => {
    return (

        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "button" color = "black">Left Panel
                    </Typography>
                </Paper>
        </Grid>
    )
}
